// SPDX-License-Identifier: MIT
pragma solidity >=0.8.2 <0.9.0;

// 1. 더하기, 빼기, 곱하기, 나누기 그리고 제곱을 반환받는 계산기를 만드세요
contract CALCULATOR {

    function add(uint _a, uint _b) public pure returns (uint){
        return _a + _b;
    }

    function subtract(uint _a, uint _b) public pure returns (uint){
        return _a - _b;
    }

    function multiply(uint _a, uint _b) public pure returns (uint){
        return _a * _b;
    }

    function divide(uint _a, uint _b) public pure returns (uint){
        return _a / _b;
    }

    function square(uint _a) public pure returns (uint){
        return _a * _a;
    }

}

// 2. 2개의 Input값을 가지고 1개의 output값을 가지는 4개의 함수를 만드시오. 각각의 함수는 더하기, 빼기, 곱하기, 나누기(몫)를 실행합니다.
contract CALCULATOR2 {

    function add(uint _a, uint _b) public pure returns (uint){
        return _a + _b;
    }

    function subtract(uint _a, uint _b) public pure returns (uint){
        return _a - _b;
    }

    function multiply(uint _a, uint _b) public pure returns (uint){
        return _a * _b;
    }

    function divide(uint _a, uint _b) public pure returns (uint){
        return _a / _b;
    }
}



// 3. 1개의 Input값을 가지고 1개의 output값을 가지는 2개의 함수를 만드시오. 각각의 함수는 제곱, 세제곱을 반환합니다.
contract CALCULATOR3 {

    function square(uint _a) public pure returns (uint){
        return _a * _a;
    }

    function cube(uint _a) public pure returns (uint){
        return _a * _a * _a;
    }

}


// 4. 이름(string), 번호(uint), 듣는 수업 목록(string[])을 담은 student라는 구조체를 만들고 그 구조체들을 관리할 수 있는 array, students를 선언하세요.
contract STUDENTS {
    struct Student {
        string name;
        uint number;
        string[] classes;
    }

    Student[] students;
}



// 5. 아래의 함수를 만드세요
//     1~3을 입력하면 입력한 수의 제곱을 반환받습니다.
//     4~6을 입력하면 입력한 수의 2배를 반환받습니다.
//     7~9를 입력하면 입력한 수를 3으로 나눈 나머지를 반환받습니다.
contract POWER {
    function power(uint _a) public pure returns (uint) {
        if(_a > 0 && _a < 4){
            return _a * _a;
        } else if (_a > 3 && _a <7){
            return _a * 2;
        } else if (_a > 6 && _a<10) {
            return _a % 3;
        } else {
            return 0;
        }
    }
}

// 6. 숫자만 들어갈 수 있는 array numbers를 만들고 
// 그 array안에 0부터 9까지 자동으로 채우는 함수를 구현하세요.(for 문)
contract ARRAY {
    uint[] numbers;

    function forLoop() public {
        for(uint i = 0; i < 10; i++){
            numbers.push(i);
        }
    }

    function getLoop() public view returns (uint[] memory) {
        return numbers;
    }
}

// 7. 숫자만 들어갈 수 있는 array numbers를 만들고 
// 그 array안에 0부터 5까지 자동으로 채우는 함수와 
// array안의 모든 숫자를 더한 값을 반환하는 함수를 각각 구현하세요.(for 문)
contract ARRAY2 {
    uint[] numbers;

    function forLoop1() public {
        for(uint i = 0; i < 6; i++){
            numbers.push(i);
        }
    }

    function forLoop2() public view returns (uint) {
        uint total = 0;
        for(uint i = 0; i < numbers.length; i++){
            total += numbers[i];
        }
        return total;
    }

    function getLoop() public view returns (uint[] memory) {
        return numbers;
    }
}


// 8. 아래의 함수를 만드세요
//     1~10을 입력하면 “A” 반환받습니다.
//     11~20을 입력하면 “B” 반환받습니다.
//     21~30을 입력하면 “C” 반환받습니다.
contract CHARACTER {

    function returnCharacter(uint _a) public pure returns (string memory) {
        if (_a > 0 && _a < 11){
            return "A";
        } else if (_a >10 && _a <21){
            return "B";
        } else if (_a > 20 && _a <31){
            return "C";
        } else {
            return "null";
        }
    }

}


// 9. 문자형을 입력하면 bytes 형으로 변환하여 반환하는 함수를 구현하세요.
contract BYTES {

    function toBytes(string memory _a) public pure returns (bytes memory) {
        bytes memory result = bytes(_a);
        return result;
    }
}


// 10. 숫자만 들어가는 array numbers를 선언하고
// 숫자를 넣고(push), 빼고(pop), 특정 n번째 요소의 값을 볼 수 있는(get)함수를 구현하세요.
contract ARRAY3 {
    uint[] numbers;

    function add(uint _a) public {
        numbers.push(_a);
    }

    function pop() public {
        numbers.pop();
    }

    function get(uint _n) public view returns (uint) {
        return numbers[_n-1];
    }
}

